import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';

function MyForm() {
  const [formData, setFormData] = useState({
    sl_no: '',
    customer_order_id: '',
    sales_org: '',
    distribution_channel: '',
    company_code: '',
    order_creation_date: '',
    order_amount: '',
    order_currency: '',
    customer_number: '',
    amount_in_usd: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Perform actions with form data
    console.log(formData);
  };

  const handleCancel = () => {
    setFormData({
      sl_no: '',
      customer_order_id: '',
      sales_org: '',
      distribution_channel: '',
      company_code: '',
      order_creation_date: '',
      order_amount: '',
      order_currency: '',
      customer_number: '',
      amount_in_usd: '',
    });
  };

  const inputStyle1 = {
    color: 'white',
    width : '98%',
    backgroundColor: 'transparent',
    border: 'none', 
    marginBottom: '2%',
    marginLeft: '2%',// Added margin of 2%
  };

  const inputStyle2 = {
    color: 'white',
    width: '48%',
    backgroundColor: 'transparent',
    border: 'none',
    marginBottom: '2%',
    marginLeft: '2%', // Added margin of 2%
  };

  const inputStyle3 = {
    color: 'white',
    width: '31.33%',
    backgroundColor: 'transparent',
    border: 'none', 
    marginBottom: '2%',
    marginLeft: '2%', // Added margin of 2%
  };

  const formStyle = {
    color: 'white',
    display: 'flex',
    flexDirection: 'row',
    flexWrap: 'wrap',
  };

  const divStyle1 = {
    color: 'white',
    width: '50%',
    marginUpper: '2%', // Added margin of 2%
  };

  const divStyle2 = {
    color: 'white',
    width: '50%',
    marginUpper: '2%', // Added margin of 2%
  };

  const divStyle3 = {
    color: 'white',
    width: '50%',
  };

  const divStyle4 = {
    color: 'white',
    width: '50%',
  };

  const datePickerStyle = {
    '& .MuiInputBase-root': {
      display: 'none',
    },
    '& .MuiInputBase-input[type="date"]': {
      display: 'block',
    },
  };

  return (
    <form onSubmit={handleSubmit} style={formStyle}>
      <div style={divStyle1}>
        <TextField
          label="customer_order_id"
          name="customer_order_id"
          value={formData.customer_order_id}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle2}
        />
        <TextField
          label="sales_org"
          name="sales_org"
          value={formData.sales_org}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle2}
        />
      </div>
      <div style={divStyle2}>
        <TextField
          label="distribution_channel"
          name="distribution_channel"
          value={formData.distribution_channel}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle1}
        />
      </div>
      <div style={divStyle3}>
        <TextField
          label="customer_number"
          name="customer_number"
          value={formData.customer_number}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle2}
        />
        <TextField
          label="company_code"
          name="company_code"
          value={formData.company_code}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle2}
        />
      </div>
      <div style={divStyle4}>
        <TextField
          label="order_currency"
          name="order_currency"
          value={formData.order_currency}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle3}
        />
        <TextField
          label="amount_in_usd"
          name="amount_in_usd"
          value={formData.amount_in_usd}
          onChange={handleChange}
          variant="outlined"
          style={inputStyle3}
        />
        <TextField
          label="order_creation_date"
          name="order_creation_date"
          type="date"
          value={formData.order_creation_date}
          onChange={handleChange}
          InputLabelProps={{
            shrink: true,
          }}
          variant="outlined"
          style={inputStyle3}
          className={datePickerStyle}
        />
      </div>
      <div style={{ display: 'flex', justifyContent: 'space-between', width: '100%', }}>
        <button
          type="submit"
          style={{ backgroundColor: '#fc7500', color: 'white', border: 'none', width: '50%',height: '160%' ,marginLeft: '1%' }}
        >
          Submit
        </button>
        <button
          type="button"
          onClick={handleCancel}
          style={{ backgroundColor: '#db4437', color: 'white', border: 'none', width: '50%', height: '160%' ,marginLeft: '1%' }}
        >
          Clear Data
        </button>
      </div>
    </form>
  );
}

export default MyForm;
